import classes from './UserList.module.css';
import Card from './components/UI/Card';
const UserList = (props) => {
  return (
    <Card> 
    <ul>
      {props.users.map((user)=><li>{user}</li>)}
    </ul>
    </Card>
   );
}

export default UserList;
